import React from 'react';
import './App.css';

// COMPONENTS
import Navbar from './Components/NavBar/Navbar';
import CardComponent from './Components/Cards/Cards';

class App extends React.Component {
  render() {
    return (
      <>
      <div className="main-container">
        <Navbar 
          item1={"Tienda"}
          item2={"Talleres"}
          item3={"Nosotros"}
        />
      </div>

      <div className="cardSection-container">
        <CardComponent
          img={"./src/Components/Cardscordones.png"}
          title={"Cordones"}
          description={"cordones varios"}
        />
      </div>
    </>
    );
  };
};

export default App;
